css:
.github-Popover.tooltip {
  max-width: 400px;
  padding-left: 1rem;
  padding-right: 1rem;
  box-sizing: border-box;
}
.github-Popover .tooltip-inner.tooltip-inner {
  padding: 0.5rem;
  background-color: #3b3e4d;
  border: 1px solid #2e303c;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  color: #cfd3e2;
}
.github-Popover.top .tooltip-arrow.tooltip-arrow {
  width: 1rem;
  height: 1rem;
  border-width: 0 0 1px 1px;
  border-color: #2e303c;
  background-color: #3b3e4d;
  border-bottom-right-radius: 2px;
  transform: rotate(-45deg);
}
